pragma solidity ^0.4.17;
contract Guess6 {
    //global variables
    address owner;
    //modifiers
    modifier restricted() {
        require(msg.sender == owner);
        _;
    }
    // initialize
    function Guess6() public {
        owner = msg.sender;
    }
    function kill() public {
        if(msg.sender == owner) selfdestruct(owner);
    }

    function makeGuessesArray(uint8 guess0, uint8 guess1, uint8 guess2, uint8 guess3, uint8 guess4, uint8 guess5) public view returns(uint[7], string)  {
        uint8[6] memory guesses;
        guesses[0] = guess0;
        guesses[1] = guess1;
        guesses[2] = guess2;
        guesses[3] = guess3;
        guesses[4] = guess4;
        guesses[5] = guess5;
        return createGuesses(guesses);
    }

    function createGuesses(uint8[6] guesses) public view returns (uint[7], string) {
        uint[7] memory resultArray;
        uint16 adder = guesses[0] + guesses[1] + guesses[2] + guesses[3] + guesses[4] + guesses[5];
        uint16 correctCount = 0;
        string memory result_answer;

        uint timeNow  = now/100 + adder;
        resultArray[0] = timeNow % 9;
        resultArray[1] = timeNow % 3;
        resultArray[2] = timeNow % 5;
        resultArray[3] = timeNow % 7;
        resultArray[4] = timeNow % 8;
        resultArray[5] = timeNow % 2;

        resultArray[6] = timeNow;

        for(uint8 i = 0; i < 6; i++){
            if(resultArray[i] == guesses[i]) {
                correctCount++;
          }
        }
        if (correctCount == guesses.length){
            result_answer = "you got the Flag:  WPI{All_Hail_The_Mighty_Vitalik}";
        } else {
            result_answer = "Try again";
        }
      return (resultArray, result_answer);
    }
}
